INSERT INTO `gv_flights` (`id`, `name`, `body`, `placeId`, `cost`, `weight`, `published`, `created`, `modified`)
VALUES
	(3,'Brussel center','<h3><img alt=\"Generic placeholder image\" src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/9/95/Province_of_Antwerp_%28Belgium%29_location.svg/577px-Province_of_Antwerp_%28Belgium%29_location.svg.png?uselang=fr\" style=\"height:140px; width:140px\" />√¢‚Ç¨‚Äπ</h3>\r\n\r\n<p>Donec sed odio dui. Etiam porta sem malesuada magna mollis euismod. Nullam id dolor id nibh ultricies vehicula ut id elit. Morbi leo risus, porta ac consectetur ac, vestibulum at eros. Praesent commodo cursus magna.</p>\r\n',56,675,0,1,'2015-05-25 01:05:21','2015-06-29 22:53:27'),
	(5,'Grand Duchy of Luxembourg','<p><img alt=\"Generic placeholder image\" src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/4/4b/Province_of_Luxembourg_%28Belgium%29_location.svg/500px-Province_of_Luxembourg_%28Belgium%29_location.svg.png\" style=\"height:140px; width:140px\" /></p>\r\n\r\n<p>Donec sed odio dui. Cras justo odio, dapibus ac facilisis in, egestas eget quam. Vestibulum id ligula porta felis euismod semper. Fusce dapibus, tellus ac cursus commodo, tortor mauris condimentum nibh, ut fermentum massa justo sit amet risus.</p>\r\n',0,715,1,1,'2015-05-25 01:07:10','2015-06-29 18:30:54'),
	(6,'Brabant Walloon','<p><img alt=\"url.png\" src=\"webkit-fake-url://ACAF28A3-5390-46E8-A97C-F46D9EF87B52/url.png\" /></p>\r\n\r\n<p>- Objet: r&eacute;alisation de photos et vid&eacute;os a&eacute;riennes&nbsp;sur commande.<br />\r\n- Caract&eacute;ristiques: Vol sans porte en&nbsp;h&eacute;licopt&egrave;re R44, &agrave; basse, moyenne et haute altitude. Boitiers&nbsp;Full frame D800 et D800E, 36 Mpxls, optiques 14-24, 24-70 et 70-200 f2/8,&nbsp;gyroscope 3 axes.<br />\r\n- Dates: R&eacute;alisation Septembre 2015,&nbsp;en semaine lors d&#39;une journ&eacute;e ensoleill&eacute;e;&nbsp;R&eacute;servation avant le 2 Septembre&nbsp;(briefing pr&eacute;alable sur site &agrave; partir du 3/09)&nbsp;</p>\r\n',4,485,2,1,'2015-06-29 15:08:01','2015-06-29 15:41:51');
