ute;finir avec lui le travail &agrave; r&eacute;aliser</p>\r\n\r\n<p><br />\r\nDepuis le premier contact jusqu&rsquo;&agrave; l&rsquo;arriv&eacute;e de l&rsquo;h&eacute;licopt&egrave;re sur le site, le client est constament tenu inform&eacute; du d&eacute;roulement des &eacute;tapes de la mission.</p>\r\n'),
