	(19,'fr','Wysiwyg',7,'value','<h1>Global View</h1>\r\n<p>Global View est une soci√É¬©t√É¬© sp√É¬©cialis√É¬©e dans la prise de vue a√É¬©rienne. Global View r√É¬©alise vos photos et vid√É¬©os professionelles en h√É¬©licopt√É¬®re.</p>\r\n<p><a class=\"btn btn-lg btn-primary\" href=\"/fr/nos-services\" role=\"button\">Nos services</a></p>'),
	(20,'nl','Wysiwyg',7,'value','Texte √É¬† traduire: <p>Global View est une soci√É¬©t√É¬© sp√É¬©cialis√É¬©e dans la prise de vue a√É¬©rienne.</p>\r\n<p>Global View r√É¬©alise vos photos et vid√É¬©os professionelles en h√É¬©licopt√É¬®re.</p>\r\n<p>Depuis 2002, Global View enrichi sans cesse sa collection de photographies a√É¬©riennes de la Belgique et du Luxembourg.</p>\r\n<p><a class=\"btn btn-lg btn-primary\" href=\"/fr/nos-services\" role=\"button\">D√É¬©couvrir</a></p>'),
	(21,'en','Wysiwyg',7,'value','Texte √É¬† traduire: <p>Global View est une soci√É¬©t√É¬© sp√É¬©cialis√É¬©e dans la prise de vue a√É¬©rienne.</p>\r\n<p>Global View r√É¬©alise vos photos et vid√É¬©os professionelles en h√É¬©licopt√É¬®re.</p>\r\n<p>Depuis 2002, Global View enrichi sans cesse sa collection de photographies a√É¬©riennes de la Belgique et du Luxembourg.</p>\r\n<p><a class=\"btn btn-lg btn-primary\" href=\"/fr/nos-services\" role=\"button\">D√É¬©couvrir</a></p>'),
	(25,'fr','Wysiwyg',9,'value','<h2>Photographie a&eacute;rienne</h2>\r\n\r\n<p>Global View sprl est une soci&eacute;t&eacute; sp&eacute;cialis&eacute;e dans la&nbsp;<strong>photographie a&eacute;rienne oblique &agrave; caract&egrave;re esth&eacute;thique</strong>.&nbsp;Depuis 2002, Simon Schmitt et ses collaborateurs fournissent des photos de grande qualit&eacute; &agrave; des publics vari&eacute;s&nbsp;: d&eacute;couvrez les t&eacute;moignages.</p>\r\n\r\n<p>Le point de vue a&eacute;rien est id&eacute;al pour mettre en valeur certaines caract&eacute;ristiques d&rsquo;un bien ou d&rsquo;un site.&nbsp;Am&eacute;liorez votre communication en illustrant vos brochures, salles de r&eacute;union, mat&eacute;riels promotionnels, site web, etc... par des vues a&eacute;riennes de grande qualit&eacute;.&nbsp;Global View tient &agrave; votre disposition une &eacute;quipe de professionnels pr&ecirc;te &agrave; r&eacute;aliser pour vous des&nbsp;<strong>photos sur mesure</strong>.</p>\r\n\r\n<p>Global View, dispose &eacute;galement d&rsquo;une importante collection de plus d&rsquo;un million de photographies a&eacute;riennes de la Belgique et du Luxembourg.&nbsp;Depuis 2002,&nbsp;<strong>notre phototh&egrave;que</strong>&nbsp;s&rsquo;enrichit &agrave; chaque vol de nouveaux clich&eacute;s pr&ecirc;ts &agrave; &ecirc;tre d&eacute;clin&eacute;s en fonction de vos d&eacute;sid&eacute;ratas.</p>\r\n\r\n<h3>Approche et services</h3>\r\n\r\n<p>Toute commande est trait&eacute;e avec le plus grand soin par Global View. Le leitmotiv est la satisfaction du client avec l&rsquo;esprit du travail bien fait.</p>\r\n\r\n<p>Depuis 2002, Simon Schmitt se consacre enti&egrave;rement &agrave; cette activit&eacute; et est aujourd&rsquo;hui devenu un des principaux acteurs de l&rsquo;univers photographique a&eacute;rien Belge.&nbsp;Pour toute nouvelle mission,&nbsp;<strong>Simon Schmitt se rend personellement</strong>&nbsp;sur place pour rencontrer son client et d&eacute;finir avec lui le travail &agrave; r&eacute;aliser.</p>\r\n\r\n<p>Depuis le premier contact jusqu&rsquo;&agrave; l&rsquo;arriv&eacute;e de l&rsquo;h&eacute;licopt&egrave;re sur le site, le client est constament tenu inform&eacute; du d&eacute;roulement des &eacute;tapes de la mission.</p>\r\n'),
