	(259,'fr','Flight',3,'body','<h3><img alt=\"\" src=\"http://cdn.xl.thumbs.canstockphoto.fr/canstock21038508.jpg\" style=\"height:163px; width:200px\" /></h3>\r\n\r\n<p>- Objet: r&eacute;alisation de photos et vid&eacute;os a&eacute;riennes&nbsp;sur commande.<br />\r\n- Caract&eacute;ristiques: Vol sans porte en&nbsp;h&eacute;licopt&egrave;re bi-turbines, &agrave; basse, moyenne et haute altitude. Boitiers&nbsp;Full frame D800 et D800E, 36 Mpxls, optiques 14-24, 24-70 et 70-200 f2/8,&nbsp;gyroscope 3 axes.<br />\r\n- Dates: R&eacute;alisation fin Ao&ucirc;t, ou septembre 2015, en semaine lors d&#39;une journ&eacute;e ensoleill&eacute;e;&nbsp;R&eacute;servation avant le 15 Juillet 2015 (d&eacute;rogation et plan de vol necessaires)</p>\r\n'),
