	(261,'nl','Flight',3,'body','<h3><img alt=\"Generic placeholder image\" src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/9/95/Province_of_Antwerp_%28Belgium%29_location.svg/577px-Province_of_Antwerp_%28Belgium%29_location.svg.png?uselang=fr\" style=\"height:140px; width:140px\" />√¢‚Ç¨‚Äπ</h3>\r\n\r\n<p>Donec sed odio dui. Etiam porta sem malesuada magna mollis euismod. Nullam id dolor id nibh ultricies vehicula ut id elit. Morbi leo risus, porta ac consectetur ac, vestibulum at eros. Praesent commodo cursus magna.</p>\r\n'),
	(262,'en','Flight',3,'name','Brussel center'),
	(263,'en','Flight',3,'body','<h3><img alt=\"Generic placeholder image\" src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/9/95/Province_of_Antwerp_%28Belgium%29_location.svg/577px-Province_of_Antwerp_%28Belgium%29_location.svg.png?uselang=fr\" style=\"height:140px; width:140px\" />√¢‚Ç¨‚Äπ</h3>\r\n\r\n<p>Donec sed odio dui. Etiam porta sem malesuada magna mollis euismod. Nullam id dolor id nibh ultricies vehicula ut id elit. Morbi leo risus, porta ac consectetur ac, vestibulum at eros. Praesent commodo cursus magna.</p>\r\n'),
	(270,'fr','Flight',5,'name','Grand-Duch√É¬© de Luxembourg'),
	(271,'fr','Flight',5,'body','<p><img alt=\"Generic placeholder image\" src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/4/4b/Province_of_Luxembourg_%28Belgium%29_location.svg/500px-Province_of_Luxembourg_%28Belgium%29_location.svg.png\" style=\"height:166px; width:200px\" /></p>\r\n\r\n<p>- Objet: r&eacute;alisation de photos et vid&eacute;os a&eacute;riennes&nbsp;sur commande.<br />\r\n- Caract&eacute;ristiques: Vol sans porte en&nbsp;h&eacute;licopt&egrave;re R44, &agrave; basse, moyenne et haute altitude. Boitiers&nbsp;Full frame D800 et D800E, 36 Mpxls, optiques 14-24, 24-70 et 70-200 f2/8,&nbsp;gyroscope 3 axes.<br />\r\n- Dates: R&eacute;alisation premi&egrave;re quinzaine de Septembre,&nbsp;en semaine lors d&#39;une journ&eacute;e ensoleill&eacute;e;&nbsp;R&eacute;servation avant le 18 Aout&nbsp;2015 (briefing pr&eacute;alable sur site &agrave; partir du 19/08)&nbsp;</p>\r\n'),
	(272,'nl','Flight',5,'name','Groussherzogtum L√É¬´tzebuerg'),
	(273,'nl','Flight',5,'body','<p><img alt=\"Generic placeholder image\" src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/4/4b/Province_of_Luxembourg_%28Belgium%29_location.svg/500px-Province_of_Luxembourg_%28Belgium%29_location.svg.png\" style=\"height:140px; width:140px\" /></p>\r\n\r\n<p>Donec sed odio dui. Cras justo odio, dapibus ac facilisis in, egestas eget quam. Vestibulum id ligula porta felis euismod semper. Fusce dapibus, tellus ac cursus commodo, tortor mauris condimentum nibh, ut fermentum massa justo sit amet risus.</p>\r\n'),
	(274,'en','Flight',5,'name','Grand Duchy of Luxembourg'),
	(275,'en','Flight',5,'body','<p><img alt=\"Generic placeholder image\" src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/4/4b/Province_of_Luxembourg_%28Belgium%29_location.svg/500px-Province_of_Luxembourg_%28Belgium%29_location.svg.png\" style=\"height:140px; width:140px\" /></p>\r\n\r\n<p>Donec sed odio dui. Cras justo odio, dapibus ac facilisis in, egestas eget quam. Vestibulum id ligula porta felis euismod semper. Fusce dapibus, tellus ac cursus commodo, tortor mauris condimentum nibh, ut fermentum massa justo sit amet risus.</p>\r\n'),
