INSERT INTO `gv_wysiwygs` (`id`, `key`, `value`, `singleline`, `created`, `modified`)
VALUES
	(1,'home.accueil','<p>Texte &agrave; traduire en en:</p>\r\n\r\n<p>Global View est une soci&eacute;t&eacute; sp&eacute;cialis&eacute;e dans la prise de vue a&eacute;rienne.</p>\r\n\r\n<p>Global View r&eacute;alise vos photos et vid&eacute;os professionelles en h&eacute;licopt&egrave;re.</p>\r\n\r\n<p>Depuis 2002, Global View enrichi sans cesse sa collection de photographies&nbsp;a&eacute;riennes de la Belgique et du Luxembourg.</p>\r\n\r\n<p>Sa&nbsp;<a href=\"%s\">phototh&egrave;que</a>&nbsp;de %s photos&nbsp;est &agrave; votre disposition.</p>\r\n',0,'2015-01-23 12:34:23','2015-05-20 09:34:49'),
	(2,'our-service.services','<p>ddddd</p>\n\n<p>d</p>\n\n<p>d</p>\n\n<p>&nbsp;</p>\n\n<p>dd</p>\n\n<p>d</p>\n\n<p>&nbsp;</p>\n\n<p>d</p>\n\n<p>d</p>\n',0,'2015-01-29 23:43:08','2015-05-20 09:41:23'),
	(3,'our-service.techniques','<h2>Texte &agrave; traduire:</h2>\r\n\r\n<h3>Le photographe</h3>\r\n\r\n<p>Simon Schmitt est d&rsquo;origine fran&ccedil;aise. Il s&rsquo;est install&eacute; en Belgique au d&eacute;but des ann&eacute;es 2000 et n&rsquo;a depuis cess&eacute; d&rsquo;explorer et d&rsquo;aimer son pays (d&rsquo;accueil&nbsp;?).&nbsp;Simon Schmitt est architecte de formation ce qui lui donne un regard affin&eacute; sur les &eacute;l&eacute;ments du relief, l&rsquo;appr&eacute;ciation d&rsquo;un site dans son environnement tridimentionnel et la multitude d&rsquo;angles d&rsquo;approche.&nbsp;Cela explique cette touche personnelle qui fait la r&eacute;putation de son travail.</p>\r\n\r\n<p>Pour pouvoir valoriser un site de construction dans son ensemble, il avait introduit le premier en Belgique la prise de vue a&eacute;rienne &agrave; partir d&rsquo;un Zepelin captif. Mais rapidement, le ballon captif s&rsquo;est av&eacute;r&eacute; limit&eacute; dans ses possibilit&eacute;s (altitude max de travail, poids du mat&eacute;riel limit&eacute;, rayon d&rsquo;action restreint). C&rsquo;est tout naturellement que Simon Schmitt s&rsquo;est alors orient&eacute; vers &nbsp;la prise de vue &agrave; partir d&rsquo;h&eacute;licopt&egrave;res, alli&eacute;s par excellence du photographe a&eacute;rien.&nbsp;En artisan (professionnel&nbsp;?)exigeant, Simon Schmitt travaille toujours avec le meilleur mat&eacute;riel (boitiers et optiques) disponible sur le march&eacute;.</p>\r\n\r\n<h3>L&rsquo;h&eacute;licopt&egrave;re</h3>\r\n\r\n<p>Les avantages de la prise de vue en h&eacute;licopt&egrave;re sont nombreux:</p>\r\n\r\n<ul>\r\n	<li>L&rsquo;h&eacute;licot&egrave;re permet de voler &agrave; <strong>toutes les altitudes</strong>, du sol &agrave; plus de 1000 m&egrave;tres selon les besoins. Cela permet de r&eacute;aliser aussi bien des <strong>vues rapproch&eacute;es</strong> ou de d&eacute;tails, que des <strong>vues d&rsquo;ensemble, </strong>m&ecirc;me pour de <strong>grands sites</strong>, sans necessaire recours &agrave; un objectif grand-angulaire.</li>\r\n	<li>L&rsquo;h&eacute;licopt&egrave;re peut voler <strong>partout</strong>&nbsp;! Sauf &agrave; quelques rares exceptions&nbsp;comme les propri&eacute;t&eacute;s royales, certains domaines militaires ou installations nucl&eacute;aires, il exploite &agrave; sa guise la totalit&eacute; de l&rsquo;espace a&eacute;rien. Certaines zones necessitent toutefois une d&eacute;rogation de survol (zone interdite de Bruxelles par exemple) et pour une question de s&eacute;curit&eacute;, l&rsquo;utilisation obligatoire d&rsquo;h&eacute;licopt&egrave;res bi-turbines lors les vols &agrave; basse altitude sur les grandes agglom&eacute;rations.</li>\r\n	<li>Du point de vue photographique surtout, l&rsquo;h&eacute;licopt&egrave;re permet au bin&ocirc;me pilote+photographe de se positionner pr&eacute;cis&eacute;ment et avec une <strong>grande souplesse</strong> (vitesse, rayon de gyration, recul ou rapprochement) afin de rechercher &agrave; loisir les angles et cadrages les plus pertinents.&nbsp;NB&nbsp;: les vols sont toujours r&eacute;alis&eacute;s sans porte&nbsp;: le photographe peut ainsi utiliser de mani&egrave;re optimale le mat&eacute;riel photographique performant dont il dispose &agrave; bord.</li>\r\n	<li>Le <strong>grand rayon d&rsquo;action</strong> de l&rsquo;h&eacute;licopt&egrave;re permet de r&eacute;aliser un nombre important de missions en un temps r&eacute;duit et de profiter ainsi pleinement des rares jours de beau temps mettant en valeur les sites.</li>\r\n</ul>\r\n\r\n<p>Simon Schmitt pr&eacute;pare ses missions en amont et <strong>optimise</strong> ses plans de vol. Son r&eacute;seau d&rsquo;excellents pilotes et les nombreux h&eacute;liports &agrave; disposition lui permettent de proposer ses services de grande qualit&eacute; &agrave; des <strong>prix tr&egrave;s avantageux</strong>.</p>\r\n',0,'2015-01-29 23:49:24','2015-05-20 09:41:48'),
	(4,'our-service.library','<p>Lors des vols command&eacute;s de Global View, Simon Schmitt a pour habitude de ballader ses objectifs dans le ciel de nos villes, villages et campagnes, chateaux ou autres sites remarquables.&nbsp;Depuis 2002, vol apr&egrave;s vol, Global View s&rsquo;est ainsi enrichi d&rsquo;une&nbsp;<strong>collection impressionante de plus d&rsquo;un million de clich&eacute;s</strong>. &nbsp;Ce vaste choix de photos a&eacute;riennes est aujourd&rsquo;hui propos&eacute; &agrave; des prix avantageux dans notre phototh&egrave;que.</p>\r\n\r\n<p>Recherchez&nbsp;par&nbsp;<strong>localisation&nbsp;g&eacute;ographique sur la carte,&nbsp;</strong>par&nbsp;<strong>mots cl&eacute;s</strong><strong>,</strong>&nbsp;ou visitez&nbsp;nos&nbsp;<strong>galeries th&eacute;matiques</strong>&nbsp;<strong>!</strong></p>\r\n\r\n<p>NB&nbsp;:&nbsp;<strong>Les photos pr&eacute;sent&eacute;es sur ce site ne constitue qu&rsquo;un petit &eacute;chantillon de la base de donn&eacute;es dont dispose Global View&nbsp;</strong>: le processus de r&eacute;f&eacute;rencement complet des photos est actuellement en cours&nbsp;; chaque nouveau vol entraine de nouveaux clich&eacute;s &agrave; encoder&nbsp;! N&#39;h&eacute;sitez pas &agrave;&nbsp;<strong>nous</strong>&nbsp;<strong>confier&nbsp;votre recherche</strong>&nbsp;pour trouver un site n&rsquo;aparaissant pas encore dans la phototh&egrave;que.</p>\r\n',0,'2015-01-29 23:53:40','2015-06-29 18:20:16'),
	(5,'our-service.prices','<p>Texte &agrave; traduire:</p>\r\n\r\n<h3 style=\"color:#aaa; font-style:italic\"><em>R&eacute;alisation de photographies a&eacute;rienes sur mesure&nbsp;</em><em>:</em></h3>\r\n\r\n<p>Pendant la<strong> pleine saison</strong>, en fonction des demandes qui nous parviennent, nous planifions nos vols et proposons un <strong>prix forfaitaire par cible</strong>.</p>\r\n\r\n<p>Ce <strong>tarif r&eacute;duit</strong> d&eacute;coule du fait que Les prises de vues sont r&eacute;alis&eacute;es lors de vols collectifs regroupant plusieurs clients d&rsquo;une m&ecirc;me zone g&eacute;ographique.</p>\r\n\r\n<p>Sans aucune concession &agrave; la qualitt&eacute;, ces forfaits comprennent :</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>un rep&eacute;rage au sol incluant un <strong>brieifng pr&eacute;alable</strong> sur place avec le client,</p>\r\n	</li>\r\n	<li>\r\n	<p>tous les frais li&eacute;s &agrave; la bonne r&eacute;alisation des clich&eacute;s (h&eacute;licopt&egrave;re, pilote, photographe, frais administratifs),</p>\r\n	</li>\r\n	<li>\r\n	<p>l&rsquo;<strong>optimisation</strong> graphique des images r&eacute;alis&eacute;es,</p>\r\n	</li>\r\n	<li>\r\n	<p>la remise de l&rsquo;ensemble du travail, apr&egrave;s <strong>validation</strong>, en <strong>format num&eacute;rique haute r&eacute;solution</strong> sur DVD ou via t&eacute;l&eacute;chargement,</p>\r\n	</li>\r\n	<li>\r\n	<p>la <strong>licence</strong> pour toutes les utilisations commerciales sans limite de dur&eacute;e</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Bien sur, une <strong>commande urgente</strong> peut &ecirc;tre r&eacute;alis&eacute;e &agrave; tout moment; hors de la logique collective, les tarifs forfaitaires ne sont alors toutefois &nbsp;pas garantis. Les tarifs seront d&egrave;s lors adapt&eacute;s &agrave; la commande en fonction de sa sp&eacute;cificit&eacute;.</p>\r\n\r\n<p>Lorsque cela est justifi&eacute; (<strong>plusieurs cibles, commandes r&eacute;ccurentes</strong>), un prix global peut par ailleurs &ecirc;tre discut&eacute;.</p>\r\n\r\n<p>A titre informatif, consultez les <strong>tarifs forfaitaires par cible</strong> de nos derniers vols.</p>\r\n\r\n<h3 style=\"color:#aaa; font-style:italic\"><em>Achat de clich&eacute;s existants&nbsp;: </em></h3>\r\n\r\n<p>Si vous souhaitez acheter une ou plusieurs de nos photos existantes de <strong>notre phototh&egrave;que</strong>, nous vous informons que nos tarifs sont bas&eacute;s sur ceux de la SOFAM (Soci&eacute;t&eacute; d&rsquo;Auteurs Sp&eacute;cialis&eacute;e dans les Arts Visuels) et que nous tarifons nos photos &agrave; 150% des montants de base &eacute;tablis par la SOFAM. Suivez ce lien pour connaitre les tarifs&nbsp;:</p>\r\n\r\n<p><a href=\"http://www.sofam.be/dbfiles/mfile/800/807/SAC194_2013_FR_Tarif_Sofam_WEB.pdf\">http://www.sofam.be/dbfiles/mfile/800/807/SAC194_2013_FR_Tarif_Sofam_WEB.pdf</a> &nbsp;et multipliez les montants qui s&rsquo;y trouvent par 1,5.</p>\r\n\r\n<h3 style=\"color:#aaa; font-style:italic\"><em>D&eacute;lais&nbsp;:</em>&nbsp;</h3>\r\n\r\n<p>Dans le cadre des commandes en &laquo;&nbsp;vol group&eacute;&nbsp;&raquo;, Global View survole chaque ann&eacute;e et &agrave; plusieurs reprises l&rsquo;ensemble de la Belgique et du Grand Duch&eacute; du Luxembourg. Le nombre toujours plus grand de clients qui nous font confiance permet d&rsquo;offrir des d&eacute;lais de r&eacute;alisation tr&egrave;s courts, g&eacute;n&eacute;ralement de l&rsquo;ordre de <strong>quelques semaines</strong>.</p>\r\n\r\n<p>Renseignez-vous sur nos prochains vols.</p>\r\n',0,'2015-01-29 23:56:47','2015-05-20 09:42:40'),
	(6,'home.teaser-phototheque','<p>Texte &agrave; traduire:</p>\r\n\r\n<h1>Phototh&egrave;que.</h1>\r\n\r\n<p>Cras justo odio, dapibus ac facilisis in, egestas eget quam. Donec id elit non mi porta gravida at eget metus. Nullam id dolor id nibh ultricies vehicula ut id elit.</p>\r\n\r\n<p><a href=\"#\">Learn more</a></p>\r\n',0,'2015-02-02 22:22:32','2015-05-20 09:42:49'),
	(7,'teaser-services','Texte √É¬† traduire: <p>Global View est une soci√É¬©t√É¬© sp√É¬©cialis√É¬©e dans la prise de vue a√É¬©rienne.</p>\r\n<p>Global View r√É¬©alise vos photos et vid√É¬©os professionelles en h√É¬©licopt√É¬®re.</p>\r\n<p>Depuis 2002, Global View enrichi sans cesse sa collection de photographies a√É¬©riennes de la Belgique et du Luxembourg.</p>\r\n<p><a class=\"btn btn-lg btn-primary\" href=\"/fr/nos-services\" role=\"button\">D√É¬©couvrir</a></p>',0,'2015-02-02 22:42:11','2015-05-20 09:43:15'),
